__ht__function(json, dm, gv, datas) {graphView.setMovableFunc(function(data) { return false });     // 禁止图元移动
graphView.getSelectWidth = function() {return 0};
// 设置当前时间
function updateDateTime() {	
	var titleDate = dm.getDataByTag('date');   // 日期
	var titleTime = dm.getDataByTag('time');   // 时间
	var titleDay = dm.getDataByTag('day');      // 周几
    var now = new Date();
    var year = now.getFullYear();    // 得到年份
    var month = now.getMonth();      // 得到月份
    var date = now.getDate();        // 得到日期
	var day = now.getDay();			 // 得到周几
    var hour = now.getHours();       // 得到小时
    var minu = now.getMinutes();     // 得到分钟
    var sec = now.getSeconds();      // 得到秒
    month = month + 1;
    if (month < 10) month = '0' + month;
    if (date < 10) date = '0' + date;
    if (hour < 10) hour = '0' + hour;
    if (minu < 10) minu = '0' + minu;
    if (sec < 10) sec = '0' + sec;
    var currentTime = '';
	var currentDate = '';
	var currentDay = '';
	currentTime = hour + ':' + minu + ':' + sec;
	currentDate = year + '-' + month + '-' + date +'';
	currentDay = '星期' +  '日一二三四五六'.charAt(new Date().getDay());
	titleDate.s('text', currentDate);	// 设置当前日期	
	titleTime.s('text', currentTime);	// 设置当前时间
	titleDay.s('text', currentDay);     // 设置周几
};
setInterval(updateDateTime, 1000); 


function changeNum() {
    var preText = [];        // 压力
    var preTags = [];
    for (var i = 0; i < 6; i++) {
    	preText.push('pressure' + i);
    	preTags.push(dm.getDataByTag(preText[i]));
    }
    var tempText = [];      // 温度
    var tempTags = [];
    for (var i = 0; i < 6; i++) {
    	tempText.push('temp' + i);
    	tempTags.push(dm.getDataByTag(tempText[i]));
    }
    var flowText = [];      // 流量
    var flowTags = [];
    for (var i = 0; i < 6; i++) {
    	flowText.push('flow' + i);
    	flowTags.push(dm.getDataByTag(flowText[i]));
    }
    var randomPre = Math.floor(Math.random() * (5 - 2 + 1) + 2);
    var randomTemp = Math.floor(Math.random() * (36 - 10 + 1) + 10);
    var randomFlow = Math.floor(Math.random() * (12 - 3 + 1) + 3);
    for(var n = 0; n < preTags.length; n++) {
        preTags[n].s('text', (randomPre + 0.5 * n).toFixed(2));
    }
    for(var n = 0; n < tempTags.length; n++) {
        tempTags[n].s('text', (randomTemp + 0.5 * n).toFixed(2));
    }
    for(var n = 0; n < flowTags.length; n++) {
        flowTags[n].s('text', (randomFlow + 0.5 * n).toFixed(2));
    }
}
setInterval(changeNum, 500);

// 流动
function animFlow() {
	ht.Default.startAnim({
		duration: 20000,
		easing: function (t) { return  t },
		flowing: dm.getDataByTag('flowing'),   // 流动
		action: function (v, t) {
            var num = 0;
			this.flowing.a('offsetReduce', 0 + (-500 - num) * v);
			this.flowing.a('offsetAdd', 0 + (500 - num) * v);	
		},
		finishFunc: function () {
			animFlow();
		}
	});
}
animFlow();

// 雨天
function animRain0() {
	ht.Default.startAnim({
		duration: 5000,
		easing: function (t) { return t * t },
		rain: dm.getDataByTag('rain'),  
		speed: 2,
		num: 20.87624,
		action: function (v, t) {
			this.num = this.num + this.speed;
			this.rain.a('offsetY0', [8.40768,this.num,0.04397,5.0939]);
			if(this.num >= 25) {
				this.num = 20.87624;
			}	
		},
		finishFunc: function () {
			animRain0();
		}
	});
}
animRain0();

